import { useState } from "react";
import Input from "./Input";
function App() {
  const [value, setValue] = useState();

  const handleSubmit = (event) => {
    setValue(event.target.value);
  };

  return (
    <>
      <Input type="text" value={value} handleSubmit={handleSubmit} />
    </>
  );
}

export default App;
